import { Box, Button } from "@mui/material";
import React, { useState } from "react";
import RandomQuotes from "../../component/RandomQuotes/index.tsx";

const ReRenderPage = () => {
  const [click, setClick] = useState<number>(0);
  console.log("parent rerendered");
  return (
    <>
      <Box>
        <h1>ReRenderPage</h1>
        <p>This is the ReRenderPage component.</p>
        <RandomQuotes />
        <Button
          variant="contained"
          onClick={() => {
            setClick((prev) => (prev += 1));
          }}
        >
          {"Click me not to render quote"}
        </Button>
        <Box sx={{ padding: "1rem", backgroundColor: "greenyellow" }}>
          {click}
        </Box>
        {click % 2 === 0 ? (
          <Box sx={{ padding: "1rem", backgroundColor: "greenyellow" }}>
            {"even"}
          </Box>
        ) : (
          <Box sx={{ padding: "1rem", backgroundColor: "aqua" }}>{"odd"}</Box>
        )}
      </Box>
    </>
  );
};
export default ReRenderPage;
